  Maintenance Code, the Department of Housing rnPreservation and Development (HPD)
  issues violations against conditions in rental rndwelling units that have been verified
  to violate the New York City Housing rnMaintenance Code (HMC) or the New York State
  Multiple Dwelling Law (MDL). rnViolations are issued when an inspection verifies
  that a violation of the HMC or MDL rnexists. It is closed when the violation is
  corrected, as observed/verified by HPD or as rncertified by the landlord.\",\n\t\"license_title\":
